import React from 'react';

import Header from '../components/Header';

function HomePage() {
  return (
    <div>
      <Header />
      <div className="h-full">
        <iframe src="https://www.youtube.com/embed/1QD0FeZyDtQ?controls=0&showinfo=0&rel=0&autoplay=1&loop=1&playlist=1QD0FeZyDtQ" 
        frameborder="0" allowfullscreen />
      </div>
    </div>
  );
}

export default HomePage;
